import React, {useState, useEffect} from 'react';
import { useDispatch, useSelector } from 'react-redux';



export default function Loginpage() {
  const [email, setemail] = useState('')
  const [password, setpassword] = useState('')
  return (
    <div>
      <div className="row justify-content-center m-5">
        <div className="col-md-5 text-start">
          <h2 className="text-center m-2" style={{ fontSize: "35px"}}>Login</h2>
          <div>
            <input required type="text" placeholder="Email" className="form-control" value={email} onChange={(e)=>{setemail(e.target.value)}}></input>
            <input required type="text" placeholder="Password" className="form-control" value={password} onChange={(e)=>{setpassword(e.target.value)}}></input>
          </div>
        </div>

      </div>
    </div>
  )
}
